@DarrenCurtis_Christies offering this AUD $9,000,000 (guide) sydney harbour residence with spectacular sweeping views, privacy and luxury of living. A magnificently modern Clontarf residence equipped with everything a family needs and so close to one of the best of the Sydney Harbour beaches. A well-built, supremely comfortable home with north-west aspect offering 180-degree sunrise and sunset views. Five bedrooms plus study, three bathrooms. Front yard with basketball court and landscaped sitting area, level grassed backyard off family/ rumpus room. Newly constructed oversized double lock up garage with excellent storage
937sq m block, rear lane access to level back yard. Short walk to Clontarf Beach, Sandy Bay, Clontarf Reserve, local shops and direct transport links to city.

Contact @DarrenCurtis_Christies for more information
